import React from "react";
import "./news.scss";

const News = ({ name, imgURl, message }) => {
  return (
    <div className="newsbox">

      <img src={process.env.PUBLIC_URL + imgURl} />
      <h>{name}</h>
      <p>{message}</p>
    </div>
  );
};

export default News;
